    provenance_text: 'The artist (d. 1926); sold to Ernest Hosched\u00e9, Paris and Montgeron, Mar. 1877 [this and the following per Wildenstein 1996]. Georges de Bellio (d. 1894), Paris, 1878; by descent his daughter Victorine (de Bellio) Donop de Monchy and son-in-law Eug\u00e8ne Donop de Monchy, Paris, 1894 [per Niculescu, Paragone 249 (Nov. 1970)]. Bernheim-Jeune, Paris, around 1899 [this and the following per Wildenstein 1996]. Paul Rosenberg, Paris, by Oct. 13, 1911; sold to Durand-Ruel, Paris, Oct. 13, 1911, for 13,000 francs [per Durand-Ruel, Paris, stock book for 1901 (no. 9749, as La gare Saint-Lazare, le train de Normandie), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, to the Art Institute of Chicago, Oct. 5, 2010, curatorial object file]. Durand-Ruel, New York, by Dec. 16, 1911 [this and the following per Durand-Ruel, New York, stock book for 1904\u201324 (no. 3502, as Paris la gare Saint-Lazare), as confirmed by Paul-Louis Durand-Ruel and Flavie Durand-Ruel, Durand-Ruel Archives, to the Art Institute of Chicago, Oct. 5, 2010, curatorial object file]; sold to Martin A. Ryerson (d. 1932), Chicago, Dec. 16, 1911, for $7,000; bequeathed to the Art Institute of Chicago, 1933.',
