    provenance_text: 'Possibly Pere Ma\u00f1ach, Paris, acquired as compensation from the artist, 1901 [New York 2006]. Paul Guillaume (1891\u20131934), Paris [Zervos 1932; Daix and Boudaille 1966]. Reinhardt Galleries, New York, by 1929 to at least 1930 [New York 1929; Providence, R.I. 1930]. Amy McCormick (Mrs. Robert R. McCormick, formerly Amie de Houle Adams, n\u00e9e Amie de Houle Irwin, May 15, 1874\u2013Aug. 16, 1939) and Colonel Robert Rutherford McCormick (July 30, 1880\u2013Apr. 1, 1955), Chicago, by July 1, 1935; given to the Art Institute, Nov. 12, 1942.',
